import React from "react";

interface PlusSvgProps {
  width?: number;
  height?: number;
  color?: string;
}

const PlusSvg = ({
  width = 24,
  height = 24,
  color = "#979797",
}: PlusSvgProps) => {
  return (
    <svg
      viewBox="0 0 32 32"
      xmlns="http://www.w3.org/2000/svg"
      aria-hidden="true"
      role="presentation"
      focusable="false"
      width={width}
      height={height}
      stroke="#979797"
    >
      <path d="m2 16h28" fill={color}></path>
    </svg>
  );
};

export default PlusSvg;
